# Create DB
CREATE DATABASE IF NOT EXISTS `soen341` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;
USE `soen341`;


# Create Table
CREATE TABLE IF NOT EXISTS `user` (
  `UserId` int(11) NOT NULL AUTO_INCREMENT,
  `UserName` varchar(45) NOT NULL,
  `Email` varchar(45) NOT NULL,
  `Password` varchar(45) NOT NULL,
  `Address` varchar(45) DEFAULT NULL,
  `CityName` varchar(45) DEFAULT NULL,
  `Province` varchar(45) DEFAULT NULL,
  `Country` varchar(45) DEFAULT NULL,
  `image` longblob,
  `PhoneNumber` int(11) DEFAULT NULL,
  PRIMARY KEY (`UserId`),
  UNIQUE KEY `Email_UNIQUE` (`Email`),
  UNIQUE KEY `UserName_UNIQUE` (`UserName`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `product` (
  `ProductId` int(11) NOT NULL AUTO_INCREMENT,
  `ProductName` varchar(45) NOT NULL,
  `ProductDetail` varchar(225) NOT NULL,
  `Price` decimal(45,0) NOT NULL,
  `Image1` blob,
  `Image2` blob,
  `UserId` int(11) DEFAULT NULL,
  `ProductCategory1` varchar(45) DEFAULT NULL,
  `ProductCategory2` varchar(45) DEFAULT NULL,
  `ProductCategory3` varchar(45) DEFAULT NULL,
  `timeStamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`ProductId`),
  KEY `UserId` (`UserId`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=latin1;


